import React from "react";

export const TileList = ({contact}) => {

  const arrayOfObj = [
    {
      name: contact.name,
      phone: contact.phone,
      email: contact.email
    }
  ]

  return (
    <div>
      <ul>
      {arrayOfObj}
      </ul>
    </div>
  );
};
